import React from 'react';
import './OpcionesActivos.css'; // Para estilos personalizados

const OpcionesActivos = () => {
  return (
    <div className="opciones-activos">
      <div className="opcion">Asignacion de Activos</div>
      <div className="opcion">Solicitud de Activos</div>
      <div className="opcion">Informacion de Activos</div>
      <div className="opcion">Depreciacion de Activos</div>
    </div>
  );
};

export default OpcionesActivos;
